export default function Logo({ variant, maxHeight, maxWidth }) {

  const defaultVariant = "large2";
  const mergedVariant = variant || defaultVariant;

  const content =  svgs[mergedVariant];

  const defaultMaxWidths = {
    small: 120,
    large: 360
  };
  let mergedMaxWidth;

  switch (mergedVariant) {
    case "small1":
    case "small2":
      mergedMaxWidth = maxWidth || defaultMaxWidths.small;
      break;
    case "large1":
    case "large2":
      mergedMaxWidth = maxWidth || defaultMaxWidths.large;
      break;
    default:
      break;
  }

  return (
    // props that start with "$" are Styled Components' "transient props" and will not be rendered on the HTML. See: https://styled-components.com/docs/api#transient-props
    <Container $maxWidth={mergedMaxWidth} $maxHeight={maxHeight}>
      { content }
    </Container>
  );
}